pragma solidity >=0.5.2 <0.9.0;

interface ILessonNine {
    function solveChallenge(
        uint256 randomGuess,
        string memory yourTwitterHandle
    ) external;
}

contract Lesson10 {
    function get() external {
        ILessonNine(0x33e1fD270599188BB1489a169dF1f0be08b83509).solveChallenge(
            uint256(
                keccak256(
                    abi.encodePacked(
                        msg.sender,
                        block.difficulty,
                        block.timestamp
                    )
                )
            ) % 1000000,
            "RanjanAshmit"
        );
    }
}

